BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "ActivityLog" (
    "Id" INTEGER NOT NULL CONSTRAINT "PK_ActivityLog" PRIMARY KEY AUTOINCREMENT,
    "UserId" INTEGER NULL,
    "ObjectType" TEXT NOT NULL,
    "ObjectId" INTEGER NULL,
    "Action" TEXT NOT NULL,
    "Details" TEXT NULL,
    "Timestamp" TEXT NOT NULL,
    CONSTRAINT "FK_ActivityLog_Users_UserId" FOREIGN KEY ("UserId") REFERENCES "Users" ("ID")
);
CREATE TABLE IF NOT EXISTS "MeetingMemberManagement" (
    "ID" INTEGER NOT NULL CONSTRAINT "PK_MeetingMemberManagement" PRIMARY KEY AUTOINCREMENT,
    "MeetingID" INTEGER NOT NULL,
    "UserID" INTEGER NOT NULL,
    CONSTRAINT "FK_MeetingMemberManagement_Meetings_MeetingID" FOREIGN KEY ("MeetingID") REFERENCES "Meetings" ("taskID") ON DELETE CASCADE,
    CONSTRAINT "FK_MeetingMemberManagement_Users_UserID" FOREIGN KEY ("UserID") REFERENCES "Users" ("ID") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "Meetings" (
    "taskID" INTEGER NOT NULL CONSTRAINT "PK_Meetings" PRIMARY KEY AUTOINCREMENT,
    "AssignedTo" INTEGER NOT NULL,
    "Hour" TEXT NOT NULL,
    "Location" TEXT NOT NULL,
    "ProjectID" INTEGER NOT NULL,
    "TaskName" nvarchar NOT NULL,
    "deadline" TEXT NOT NULL,
    "status" TEXT NOT NULL,
    CONSTRAINT "FK_Meetings_Projects_ProjectID" FOREIGN KEY ("ProjectID") REFERENCES "Projects" ("projectID") ON DELETE CASCADE,
    CONSTRAINT "FK_Meetings_Users_AssignedTo" FOREIGN KEY ("AssignedTo") REFERENCES "Users" ("ID") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "MilestoneMemberManagement" (
    "ID" INTEGER NOT NULL CONSTRAINT "PK_MilestoneMemberManagement" PRIMARY KEY AUTOINCREMENT,
    "MilestoneID" INTEGER NOT NULL,
    "UserID" INTEGER NOT NULL,
    CONSTRAINT "FK_MilestoneMemberManagement_Milestones_MilestoneID" FOREIGN KEY ("MilestoneID") REFERENCES "Milestones" ("taskID") ON DELETE CASCADE,
    CONSTRAINT "FK_MilestoneMemberManagement_Users_UserID" FOREIGN KEY ("UserID") REFERENCES "Users" ("ID") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "Milestones" (
    "taskID" INTEGER NOT NULL CONSTRAINT "PK_Milestones" PRIMARY KEY AUTOINCREMENT,
    "AssignedTo" INTEGER NOT NULL,
    "Description" TEXT NOT NULL,
    "ProjectID" INTEGER NOT NULL,
    "TaskName" nvarchar NOT NULL,
    "deadline" TEXT NOT NULL,
    "status" TEXT NOT NULL,
    CONSTRAINT "FK_Milestones_Projects_ProjectID" FOREIGN KEY ("ProjectID") REFERENCES "Projects" ("projectID") ON DELETE CASCADE,
    CONSTRAINT "FK_Milestones_Users_AssignedTo" FOREIGN KEY ("AssignedTo") REFERENCES "Users" ("ID") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "Projects" (
    "projectID" INTEGER NOT NULL CONSTRAINT "PK_Projects" PRIMARY KEY AUTOINCREMENT,
    "Project Name" nvarchar NOT NULL,
    "projectDescription" TEXT NOT NULL,
    "AdminID" INTEGER NOT NULL,
    CONSTRAINT "FK_Projects_Users_AdminID" FOREIGN KEY ("AdminID") REFERENCES "Users" ("ID") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "Tasks" (
    "taskID" INTEGER NOT NULL CONSTRAINT "PK_Tasks" PRIMARY KEY AUTOINCREMENT,
    "AssignedTo" INTEGER NOT NULL,
    "ProjectID" INTEGER NOT NULL,
    "TaskName" nvarchar NOT NULL,
    "deadline" TEXT NOT NULL,
    "status" TEXT NOT NULL,
    CONSTRAINT "FK_Tasks_Projects_ProjectID" FOREIGN KEY ("ProjectID") REFERENCES "Projects" ("projectID") ON DELETE CASCADE,
    CONSTRAINT "FK_Tasks_Users_AssignedTo" FOREIGN KEY ("AssignedTo") REFERENCES "Users" ("ID") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "Users" (
    "ID" INTEGER NOT NULL CONSTRAINT "PK_Users" PRIMARY KEY AUTOINCREMENT,
    "Email" TEXT NOT NULL,
    "Password" TEXT NOT NULL,
    "User Name" nvarchar NOT NULL
, "Avatar" BLOB NULL);
');
CREATE INDEX "IX_ActivityLog_UserId" ON "ActivityLog" ("UserId");
CREATE INDEX "IX_MeetingMemberManagement_MeetingID" ON "MeetingMemberManagement" ("MeetingID");
CREATE INDEX "IX_MeetingMemberManagement_UserID" ON "MeetingMemberManagement" ("UserID");
CREATE INDEX "IX_Meetings_AssignedTo" ON "Meetings" ("AssignedTo");
CREATE INDEX "IX_Meetings_ProjectID" ON "Meetings" ("ProjectID");
CREATE INDEX "IX_MilestoneMemberManagement_MilestoneID" ON "MilestoneMemberManagement" ("MilestoneID");
CREATE INDEX "IX_MilestoneMemberManagement_UserID" ON "MilestoneMemberManagement" ("UserID");
CREATE INDEX "IX_Milestones_AssignedTo" ON "Milestones" ("AssignedTo");
CREATE INDEX "IX_Milestones_ProjectID" ON "Milestones" ("ProjectID");
CREATE INDEX "IX_Projects_AdminID" ON "Projects" ("AdminID");
CREATE INDEX "IX_Tasks_AssignedTo" ON "Tasks" ("AssignedTo");
CREATE INDEX "IX_Tasks_ProjectID" ON "Tasks" ("ProjectID");
COMMIT;
